import { useState,useEffect } from "react";
import Checked from "./Checked";
import Task from "./Task"


const TaskList = ({data}) => {
  const [tasks,setTasks] = useState('');

  useEffect(()=>{
    setTasks(data)
  },[]);
  return (
    <div className="taskDetailList">
      <ul className="detailList">
        <li><Checked /><Task/></li>
        {}
      </ul>
    </div>
  )
}

export default TaskList;
